import { useState, useEffect } from "react";
import Rating from "@mui/material/Rating";
import Box from "@mui/material/Box";

type cardSetting = {
	rating: number;
	img: string;
	promo: string;
	color: string;
};

function SneakersCard({ rating, img, promo, color }: cardSetting) {
	const [Rating, setRating] = useState(rating);

	return (
		<Box>
			<Rating name='sneakers_rating' value={Rating} readOnly precision={0.5} />
		</Box>
	);
}
export default SneakersCard;
